        public int findNthNumber(int[] num, int startpos, int n) {
            int result = Integer.MIN_VALUE;
            int indexOf1stN = startpos;
            if (indexOf1stN == 0)
                return -1;

            int pos_before;
            boolean flag = true;
            int i;
            for (i = indexOf1stN - 1 ; i <= startpos ; i++) {
                pos_before = i == 0? 0 : num[i -1];
                if (pos_before == n) {
                    flag = false;
                } else
                    if (i!= startpos && pos_before == 1) {
                        result = num[i];
                        flag = true;
                    }
                    if (n == 0)
                        break;
            }

            if (flag)
                return - result;

            return  - result;
        }
